import React from 'react';
import Footer from '../components/Footer/Footer';
import Header from '../components/Header/Header';
import MapView from '../components/Map/MapView';

import './Home.css';


function HomePage() {


  return (
    <div>
      <Header></Header>
     

      <MapView></MapView>

      <Footer />
    </div>
  )
}

export default HomePage;
